(3, 75, 0, 2, '<div class=\"subheadline col-xsp-12 h2\">Guitare électrique Rhoads avec micros à haut rendement</div>\r\n<div class=\"module module-5 col-xsp-12\" style=\"display: block;\" data-fullsize=\"true\">\r\n<div class=\"col-xsp-12\">\r\n<div class=\"contentText\">\r\n<p>Avec la <strong>Jackson JS Series Rhoads JS32T AM Satin Black</strong>, Jackson lance une guitare métal de première classe à un prix attractif. La guitare électrique a un <strong>corps en peuplier</strong> clair et un <strong>manche en érable vissé</strong>, grâce au <strong>profil \"Speed Neck\"</strong> et à la touche Amaranth dans le <strong>rayon composé</strong>, elle a des caractéristiques de jeu extrêmement maniables. Deux <strong>humbuckers Jackson à haut rendement</strong> avec aimants en céramique fournissent des sons métalliques bruts sur l\'amplificateur de guitare, qui ne perdent pas leur précision, même avec un accordage en goutte à goutte. Enfin, le Jackson JS32T Rhoads est équipé d\'un <strong>pont Tune-O-Matic</strong> derrière lequel les cordes sont guidées à travers le corps.</p>\r\n</div>\r\n</div>\r\n</div>'),
