(17, 75, 0, 9, '<p>Le TRBX 174 est un véritable casse-prix et combine la haute qualité Yamaha avec un équipement de luxe !</p>\r\n<p>Le corps en aulne massif présente la forme TRBX typique et extrêmement ergonomique qui, grâce à ses coupes généreuses, permet un jeu confortable même dans les positions les plus hautes du manche vissé en érable. Elle porte une touche en sonoceling, qui est équipée de 24 frettes et d\'incrustations de points pour marquer les couches.</p>\r\n<p>La combinaison classique d\'une bobine fendue sur le manche et d\'une seule bobine sur le pont offre une variété de sons avec une excellente dynamique et beaucoup de pression. Les micros peuvent être combinés en continu les uns avec les autres par l\'intermédiaire des commandes de volume individuelles. L\'ouverture de tonalité vous permet de contrôler le contenu des aigus du signal.</p>\r\n<p>Le pont solide de style vintage garantit une intonation parfaite de la Yamaha TRBX 174, tandis que les mécanismes d\'accordage encapsulés et fiables assurent une grande stabilité de l\'accord.</p>\r\n<p>Caractéristiques :</p>\r\n<p>Corps : Alder Neck : Érable, vissé Fretboard : Sonokeling Fretboard Inserts : Dot Fretboard Radius : 10\" (254 mm) Frets : 24 Frets : 24 Saddle Width : 1.57\" (40 mm) Scale : 34\" (864 mm) Neck Pickup : Split Coil Pickup : Split Coil Pickup : Single Coil Controller : 2x Volume, 1x Tone Bridge : Accordeurs Vintage Style : encapsulés Couleur de la quincaillerie : chrome Fini : noir</p>'),
