(25, 75, 0, 13, '<div>\r\n<ul class=\"eigenschaften\">\r\n<li>Coloris: Black Mirage Gradation Low Gloss</li>\r\n<li>Type de construction: Corps massif/Solid body</li>\r\n<li>Forme de la caisse: Modern Strat</li>\r\n<li>Nombre de cordes: 6 cordes</li>\r\n<li>Montage manche: Manche vissé</li>\r\n<li>Nombre de frettes: 24</li>\r\n<li>Diapason: 25,5\" (64,77 cm)</li>\r\n<li>Matériau caisse: Nyatoh</li>\r\n<li>Table: Flamed Maple</li>\r\n<li>Manche: 5 pièces Panga Panga/noyer</li>\r\n<li>Profil manche: Nitro Wizard</li>\r\n<li>Touche: Ebène Makassar</li>\r\n<li>Radius touche: 15\"</li>\r\n<li>Incrustations touche: White Step off-set dot inlay</li>\r\n<li>Configuration micros: HH - 2 x Humbucker</li>\r\n<li>Micro manche: Fishman Fluence Modern</li>\r\n<li>Micro bridge (chevalet): Fishman Fluence Modern</li>\r\n<li>Sélecteur micros: Toggle 3 positions</li>\r\n<li>contrôles/réglages: 1x Volume</li>\r\n<li>Chevalet/Tremolo: Ibanez Gibraltar Standard II</li>\r\n<li>Hardware (accastillage): Cosmo Black</li>\r\n<li>Tirant des cordes sortie d\'usine: .010 - .046</li>\r\n<li>Particularité(s): switch Coil Tap, poti Push/Pull pour Fluence Voicing, insert Luminescent side dot et logo Ibanez</li>\r\n<li>Pays de production: Indonésie</li>\r\n</ul>\r\n</div>'),
