(27, 75, 0, 14, '<div class=\"module module-5 col-xsp-12 col-xlg-6\" style=\"display: block;\">\r\n<div class=\"col-xsp-12\">\r\n<div class=\"contentText\">\r\n<div class=\"subheadline col-xsp-12 h2\"><strong>Guitare électrique avec micros Seymour Duncan, vibrato Wilkinson et accordateurs à verrouillage grover.</strong></div>\r\n<div class=\"module module-5 col-xsp-12\" style=\"display: block;\" data-fullsize=\"true\">\r\n<div class=\"col-xsp-12\">\r\n<div class=\"contentText\">\r\n<p>Avec la <strong>Yamaha Pacifica 611VFMX Matte Translucent Blue</strong>, Yamaha présente une guitare électrique polyvalente avec une finition satinée élégante et des caractéristiques de haute qualité. La guitare électrique a un <strong>corps en aulne</strong> au design typique de Pacifica, sur lequel une <strong>table en érable onduleux</strong> à flammes intensives attire l\'attention, et un <strong>manche en érable vissé</strong>, sur lequel, grâce au profil confortable, chaque lèche et riff se détache facilement de la main. La combinaison d\'un <strong>Seymour Duncan Custom 5 Humbucker</strong> sur le pont et d\'un <strong>Seymour Duncan Vintage P-90 Single Coil</strong> sur le manche offre un large éventail de timbres entre pop, blues et rock classique. La guitare électrique est également équipée du <strong>Wilkinson VS-50 Vibrato</strong>, qui permet des modulations douces et chatoyantes sur les accords et les mélodies. Les <strong>tuners Grover Locking Rotomatic</strong> sur la tête d\'attelage promettent un réglage précis et stable de la Yamaha Pacifica 611VFMX.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<h3>La Yamaha Pacifica 611VFMX Mat Translucide Bleu Translucide en un coup d\'œil :</h3>\r\n<ul>\r\n<li>Guitare électrique de la série Yamaha Pacifica</li>\r\n<li>Corps en aulne avec plateau en érable ondé et planche à marteler en aluminium</li>\r\n<li>Manche en érable vissé avec touche en palissandre.</li>\r\n<li>Seymour Duncan SP90-1n Vintage P-90 Single Coil et Seymour Duncan TB-14 Custom 5 Humbucker 5 Custom Humbucker</li>\r\n<li>Wilkinson VS-50 Tremolo, Grover Locking Rotomatics, Grover Locking Rotomatics</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>'),
(28, 85, 0, 14, ' Yamaha Pacifica 611VFMX'),
(29, 75, 0, 15, '<ul class=\"prod-features\">\r\n<li><span>Signature Dimebag Darrell</span></li>\r\n<li><span>Corps en acajou</span></li>\r\n<li><span>Table en érable flammé</span></li>\r\n<li><span>Manche en acajou</span></li>\r\n<li><span>Profil du manche en V</span></li>\r\n<li><span>Touche en pau ferro</span></li>\r\n<li><span>Diapason: 629 mm (24 3/4\")</span></li>\r\n<li><span>Repères \"points\" en abalone</span></li>\r\n<li><span>22 frettes Jumbo</span></li>\r\n<li><span>Rayon de la touche: 305 mm (12\")</span></li>\r\n<li><span>Filets de corps et de manche noirs</span></li>\r\n<li><span>Sillet bloquant Floyd Rose R3</span></li>\r\n<li><span>Largeur au sillet: 43 mm (1 11/16\")</span></li>\r\n<li><span>1 micro double bobinage DMT Design BKWH (manche)</span></li>\r\n<li><span>1 micro double bobinage Seymour Duncan SH13 Dimebucker (chevalet)</span></li>\r\n<li><span>Mécaniques Grover</span></li>\r\n<li><span>Boutons des mécaniques noirs DBD Traction</span></li>\r\n<li><span>Accastillage noir</span></li>\r\n<li><span>Vibrato Floyd Rose Special</span></li>\r\n<li><span>Cordes DR DBG-9 High Voltage .009 - .042 (<a title=\"DR Strings Dimebag DBG9\" href=\"https://www.thomann.de/fr/dr_strings_dimebag_dbg9.htm\">187975</a>)</span></li>\r\n<li><span>Couleur: Dime Slime</span></li>\r\n</ul>'),
(30, 85, 0, 15, 'Dean Guitars Dimebag Dime Slime ML'),
(31, 75, 0, 16, '<div class=\"subheadline col-xsp-12 h2\"><strong>Quatre cordes Shortscale Electric Bass avec Sidewinder Humbucker Humbucker</strong></div>\r\n<div class=\"module module-5 col-xsp-12\" style=\"display: block;\" data-fullsize=\"true\">\r\n<div class=\"col-xsp-12\">\r\n<div class=\"contentText\">\r\n<p>L\'<strong>Epiphone EB-0 Cherry</strong> est une basse électrique à quatre cordes avec gamme courte, qui n\'est en aucun cas inférieure à son célèbre ancêtre. Basé sur la construction éprouvée avec un <strong>corps</strong> en <strong>acajou</strong> en forme de double SG et un <strong>manche en acajou vissé</strong>, la basse offre un confort de jeu grâce à son <strong>profil \"slim taper\"</strong> et sa <strong>longueur d\'échelle</strong> réduite de <strong>30,5 pouces (775 mm)</strong>. Le <strong>humbucker Epiphone Sidewinder</strong> sur l\'amplificateur fournit des sons particulièrement puissants avec une base de basse abyssale, jetant les bases d\'un groove parfait pour le rock classique et le blues. Enfin, l\'Epiphone EB-0 Cherry est doté d\'un <strong>pont de basses entièrement réglable</strong> et de syntoniseurs précis dans un style vintage chic.</p>\r\n<div class=\"module module-5 col-xsp-12 col-xlg-6\" style=\"display: block;\">\r\n<div class=\"col-xsp-12\">\r\n<div class=\"contentText\">\r\n<h3>L\'Epiphone EB-0 Cherry en un coup d\'œil :</h3>\r\n<ul>\r\n<li>Basse électrique à quatre cordes</li>\r\n<li>caisse en acajou</li>\r\n<li>Col vissé en acajou avec profil \"slim taper\" et touche en palissandre.</li>\r\n<li>Échelle courte de 30,5 pouces (775 mm)</li>\r\n<li>Un Pickup Epiphone Humbucker Sidewinder Humbucker en position cou.</li>\r\n<li>Epiphone Bass Bridge entièrement réglable, accordeur Vintage Style Vintage</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
(32, 85, 0, 16, 'CORT B-001 – 0805 – 0 basse électrique.5 cordes '),
(33, 75, 0, 17, '<p><span><span>La Violin Bass est l\'un des basses les plus marquantes de l\'histoire ! C\'est sans aucun doute le membre des Beatles Paul McCartney qui a, plus que quiconque, contribué à sa popularité à tel point que l\'instrument est aujourd\'hui connu sous le nom de : Beatle Bass. La Violin Bass Ignition qui nous intéresse ici est une version abordable de cette basse de légende. Elle en possède la même forme caractéristique, la couleur et le corps creux typique.</span></span></p>\r\n<p><span><span>En dehors de son look inoubliable, cette basse est équipée pour délivrer un son bien à elle. Ses deux micro humbuckers, son corps creux et ses multiples contrôles de tonalité se complètent pour former une pièces unique et polyvalente. Il est ainsi possible de gérer le volume de chaque micro indépendamment voire carrément d\'en couper un des deux selon vos envies. Que dire de plus sinon que la Violin Bass Ignition est confortable, abordable et bénéficie d\'une qualité de finition propre à Höfner.</span></span></p>'),
(34, 85, 0, 17, 'Hofner Beatles Bass Ignition Sunburst'),
(35, 75, 0, 18, '<p><span lang=\"fr\" class=\"tlid-translation translation\"><span title=\"\">Basse électrique à quatre cordes avec manche traversant et micros à simple bobinage, y compris l\'étui</span>.<br /><br /><span title=\"\">Avec le Rickenbacker 4003S Matte Black, la société américaine de longue tradition présente la version standard du légendaire modèle 4003 E-Bass, qui se concentre sur le son Rickenbacker typique en se dispensant de détails optiques opulents.</span> <span title=\"\">En conséquence, la basse à quatre cordes possède deux micros passifs à simple bobinage, un corps en érable et un manche traversant en même matériau.</span></span></p>'),
(36, 85, 0, 18, ' Rickenbacker 4003 S Matte Black'),
